{"source":{"uri":"features/specs/detalhe/detalhe_agendar_chamada.feature","data":"# language: pt\n\n@portal @detalhe\nFuncionalidade: Validar agendamento de chamada de video\n      Eu como Usuario\n  Quero agendar uma chamada de video\n  Para ter mais informações do anuncio\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @agendar_chamada_video\n  Esquema do Cenário: Validar agendamento de chamada de video\n    Quando desejo agendar uma video chamada\n      E informo o \"<Nome>\", \"<Email>\" e \"<Telefone>\" para agendar\n      E seleciono período\n    Então exibe mensagem de que foi agendado\n    Exemplos:\n      | Nome | Email         | Telefone    |\n      | Ana  | ana@gmail.com | 11992176665 |\n\n  @agendar_chamada_video_fail\n  Esquema do Cenário: Validar agendamento de chamada de video dados invalidos\n    Quando desejo agendar uma video chamada\n      E informo o \"<Nome>\", \"<Email>\" e \"<Telefone>\" para agendar\n      E seleciono período\n    Então fico impossibilitado de continuar\n    Exemplos:\n      | Nome | Email          | Telefone    |\n      | Ana  | ana##gmail.com | 11992176665 |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_carros_vendedor.feature","data":"# language: pt\n\n@portal @detalhe\nFuncionalidade: Verificar anuncios de um mesmo vendedor\n  Eu como Usuario \n  Quero verificar todos os anuncios de um vendedor\n  Para escolher a melhor opção\n\n  Contexto:\n      Dado que estou na home da webmotors\n\n  @anuncios_vendedor\n  Esquema do Cenário: \n    Quando verifico todos anuncios de um vendedor\n    Entao sou redirecionado para a lista de anuncios\n ","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_favorito.feature","data":"# language: pt\n\n@portal @busca\nFuncionalidade: Validar favorito logado\n      Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para favoritar um anuncio de minha preferência\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @favoritos_logado\n  Esquema do Cenário: Validar favorito logado web\n    E faço login como \"automacaoportal@gmail.com\" e \"Webmotors.com22\"\n    Quando realizar a busca do carro \"<modelo>\"\n    E seleciono um anúncio\n    E desejo favoritar\n    Entao o anuncio é favoritado\n    Exemplos:\n      | modelo     |\n      | Honda      |\n      | Fiat       |\n      | Chevrolet  |\n      | Ford       |\n      | Nissan     |\n      | Hyundai    |\n      | Peugeot    |\n      | Volkswagen |\n      | Renault    |\n\n  @favoritos_deslogado\n  Cenário: Validar favorito deslogado\n    Quando realizar a busca do carro \"<modelo>\"\n      E desejo adicionar aos favoritos\n      E realizo login como \"automacaoportal@gmail.com\" e \"Webmotors.com22\"\n      E adiciono aos favoritos\n    Entao vejo o anuncio favoritado\n    Exemplos:\n      | modelo     |\n      | Honda      |\n      | Fiat       |\n      | Chevrolet  |\n      | Ford       |\n      | Nissan     |\n      | Hyundai    |\n      | Peugeot    |\n      | Volkswagen |\n      | Renault    |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_lead.feature","data":"# language: pt\n\n\n\n#VERIFICAR RESULTADO DE SUCESSO DO FINANCIMANETO EM HOMOLOGAÇÃO\n#VERIFICAR COM TIME DE FINANCIAMENTO PARA PEGAR OS DADOS QUE PASSAM NAS PARCELAS\n\n@portal @detalhe @lead\nFuncionalidade: Validar envio lead\n      Eu como Usuario\n  Quero enviar uma notificação de interesse\n  Para que o vendedor entre em contato\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @envio_lead\n  Esquema do Cenário: Enviar lead já preenchido\n      E faço a busca por um \"<modelo>\"\n      E seleciono um anúncio\n    Quando envio mensagem do lead\n    Então recebo a confirmação\n    Exemplos:\n      | modelo |\n      | Honda  |\n\n\n  @denunciar_anuncio\n  Esquema do Cenário: Denunciar um anuncio\n      E faço a busca por um \"<modelo>\"\n      E seleciono um anúncio\n    Quando denuncio um anúncio\n      E preencho o formulario\n    Entao exibe mensagem enviada com sucesso\n    Exemplos:\n      | modelo |\n      | Honda  |\n\n#denuncia: validar formulario completo","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/detalhe/detalhe_parcelamento.feature","data":"# language: pt\n\n@portal @detalhe\nFuncionalidade: Validar simulação de parcelamento\n      Eu como Usuario\n  Quero simular um parcelamento\n  Para escolher a melhor opção de pagamento\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @ver_parcelas\n  Esquema do Cenário: Simular parcelamento\n      E faço a busca por um \"<modelo>\"\n      E seleciono um anúncio\n    Quando preencho o formulário para consulta\n      E decido ver parcelas avisando\n    Entao deve #VERIFICAR RESULTADO DO FINANCIMANETO EM HOMOLOGAÇÃO\n    Exemplos:\n      | modelo |\n      | Honda  |\n\n  @ver_parcelas_sem_avisar\n  Esquema do Cenário: Simular parcelamento sem avisar\n      E faço a busca por um \"<modelo>\"\n      E seleciono um anúncio\n    Quando preencho o formulário para consulta\n      E decido não avisar\n    Entao deve #VERIFICAR RESULTADO DO FINANCIMANETO EM HOMOLOGAÇÃO\n    Exemplos:\n      | modelo |\n      | Honda  |","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/specs/pesquisar_veiculo.feature","data":"# language: pt\n# encoding: utf-8\n\n@portal\nFuncionalidade: Webmotors Web\n      Eu como Usuario\n  Quero conseguir navegar pelo site\n  Para encontrar os meus futuros veículos, entrando em contato com os vendedores ou consultar preços\n\n  Contexto:\n    Dado que estou na home da webmotors\n\n  @pesquisar_veiculo\n  Esquema do Cenário: Pesquisa veiculo\n    Quando que eu pesquise o veiculo \"<modelo>\"\n    Entao deve retorna uma lista com os veiculos disponiveis\n    Exemplos:\n      | modelo     |\n      | Honda City |\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
